import React from 'react'
import contacts from '../contacts'

function CardLoop(prop) {
    for (let i = 0; i<contacts.length; i++){
        return (
            <div> 
            <div className="card">
              <div className="top">
                <h2>{prop.contacts[i].name}</h2>
                <img
                  src={prop.contacts[i].imgURL}
                  alt= "image"
                />
              </div>
              <div className="bottom">
                <p>{prop.contacts[i].phone}</p>
                <p>{prop.contacts[i].email}</p>
              </div>
            </div>
            </div>
            )
    }
  }

    export default CardLoop;
